// Receipt Item Component

import React from 'react'

class RecieptQRRow extends React.Component {
    constructor() {
      super();
      this.state = {orderData: [],mealData: []};
    }

    render() {
        return (
        <div className="row QRRow">
            <div className="col"><img src="assets/img/QR_code_for_mobile_English_Wikipedia.svg.png" className="QRImage">{/*Order QR code*/}</img>
                <h6 className="text-center">Order No: {/*Order Number*/}2219053</h6>
            </div>
        </div>
        );
    }
}

export default RecieptQRRow
